import React from 'react';


function Button(props) {

    let name = props.name;
    
    return(
        <React.Fragment>
           
                <div 
                    className= {props.classname}
                    onClick={(name) => props.onclick(name)}
                    tabIndex = {props.tabindex}
                >    
                    {props.name}

                </div>

        </React.Fragment>
    )
}

export default Button
